(82, 3191, 1, '2019-08-29 13:00:03', '2019-09-19 09:09:39', '5bb6ad81-7fbd-4682-9b18-9fbf603cff01', '<p>Wix is best for personal websites, blogs, and landing pages. It is a website building tool that offers users the opportunity to create websites through an easy to use drag and drop interface. It also has the extra features that allow powerful add-ons to be included to extend site functionality.</p>\n<p>Wix has simple editors and templates to make your website look slick. It manages all its own updates and support.</p>\n<p>Wix is fully hosted, which means that its shared platform allows storage and bandwidth among Wix users, depending on the hosting plan they have purchased. This could be a problem for a site that experiences a sudden surge in traffic or needs more resources to run secondary applications. Wix also limits a user’s options for customizing the site.</p>\n<p>That’s a trade-off new users with small sites might be willing to accept – but for site runners who crave control over all aspects of their site and the flexibility to build in new features as it evolves, there are better solutions.</p>', 'https://www.buildthis.io/growth/examples-of-websites-using-wix/', 'Wix'),
(83, 3200, 1, '2019-08-29 13:00:04', '2019-08-29 13:00:04', 'ede93391-83ed-4d36-9898-3e09cab90e98', '<p>Custom Frameworks info</p>', 'https://www.drupal.org/', 'Custom Frameworks'),
(84, 3209, 1, '2019-08-29 13:00:35', '2019-08-29 13:00:35', '4f425a1a-8e41-4871-814d-fdf2566fa1e4', '<p>Wix info</p>', 'https://www.drupal.org/', 'Wix'),
(85, 3218, 1, '2019-08-29 13:00:44', '2019-09-19 09:10:11', '0cbcd587-e55d-41bb-8365-9ceba0016892', '<p>Shopify is best for online store. It is a commerce platform that lets you create and customize an online store, sell in multiple places, manage products, inventory, payments, and shipping. It provides you with a wide range of templates that can be customized to meet individual users’ branding requirements, and it allows either physical or digital goods to be sold.</p>\n<p>Because Shopify is a hosted solution, you don’t need to worry about buying web hosting or installing software anywhere; the idea is that pretty much everything you need to build and run your store happens ‘out of the box.’ Shopify will take care of all server maintenance and upgrades to keep your store and shopping cart available at all times, and ensure that pages load quickly.</p>\n<p>Shopify has a decent security system and website load speed. It means that you won\'t need to worry about customers` payments.</p>\n<p>Of course, like any platform, Shopify has its cons. First of all, it`s necessary to pay some percentage of sales to the company. Second, most apps you will need are expensive. So to make your e-commerce website look really good, you will need to spend much more than you planned when you saw the price of Shopify.</p>', 'https://bestwebsite.gallery/sites/cms/shopify', 'Shopify'),
