(100, 3919, 1, '2019-08-30 13:22:04', '2019-08-30 13:22:04', '95331603-dbda-4e7f-bdbc-930c39ad7f12', '<p>Wordpress is best for personal website, blog, portfolio, bussiness website and landing page. It can be used also for online shops. WP is free and Open-Source content management system. It\'s quite easy to use and flexible enough to make different types of websites.</p><p>WordPress is the perfect solution if you want to use free website templates (themes). </p><p>You can also add custom functionality to your WordPress site by using plugins. WordPress plugins are like apps for your website that you can use to add advanced features like analytics, contact forms, membership area, and more.</p><p>The arguments against using WP is its security and necessity of frequent updates. Also, it can be expensive. While the WordPress itself is free, when looking at the whole picture there are significant costs. Customization needs Coding.</p>', 'https://wordpress.org/', 'Wordpress'),
(101, 3933, 1, '2019-09-13 08:34:05', '2019-09-13 08:34:05', '7e658732-d1cb-4850-bc83-21463ddf6ee2', '<p>Shopify is best for online store. It is a commerce platform that lets you create and customize an online store, sell in multiple places, manage products, inventory, payments, and shipping. It provides you with a wide range of templates that can be customized to meet individual users’ branding requirements, and it allows either physical or digital goods to be sold.</p><p>Because Shopify is a hosted solution, you don’t need to worry about buying web hosting or installing software anywhere; the idea is that pretty much everything you need to build and run your store happens ‘out of the box.’ Shopify will take care of all server maintenance and upgrades to keep your store and shopping cart available at all times, and ensure that pages load quickly.</p><p>Shopify has a decent security system and website load speed. It means that you won\'t need to worry about customers` payments.</p><p>Of course, like any platform, Shopify has its cons. First of all, it`s necessary to pay some percentage of sales to the company. Second, most apps you will need are expensive. So to make your e-commerce website look really good, you will need to spend much more than you planned when you saw the price of Shopify.</p>', 'https://www.staples.ca/', 'Shopify'),
(102, 3946, 1, '2019-09-13 08:40:46', '2019-09-13 08:40:46', 'bf7ba867-e724-49f2-aece-2129395c5693', '<p>Wix is best for personal websites, blogs, and landing pages. It is a website building tool that offers users the opportunity to create websites through an easy to use drag and drop interface. It also has the extra features that allow powerful add-ons to be included to extend site functionality.</p><p>Wix has simple editors and templates to make your website look slick. It manages all its own updates and support.</p><p>Wix is fully hosted, which means that its shared platform allows storage and bandwidth among Wix users, depending on the hosting plan they have purchased. This could be a problem for a site that experiences a sudden surge in traffic or needs more resources to run secondary applications. Wix also limits a user’s options for customizing the site.</p><p>That’s a trade-off new users with small sites might be willing to accept – but for site runners who crave control over all aspects of their site and the flexibility to build in new features as it evolves, there are better solutions.</p>', 'https://www.sonjavanduelmen.com/', 'Wix'),
(103, 4011, 1, '2019-09-13 09:02:08', '2019-09-13 09:02:08', '2b6e40c5-e84b-4055-b007-4ea7d82c9346', '<p>Craft CMS is best for development-oriented publishers who want deeper control and more powerful performance from their content management tools. Craft CMS is simple, minimalistic, agile and exceptionally scalable. It is considered a highly user-friendly CMS platform.</p><p>If you’re keen to have a sleek and flexible website solution which is tailored around your current and future business offerings, we’d recommend Craft CMS every time.</p><p>Craft CMS takes a much more content-first approach, with sites built completely bespoke and customized to the business needs rather than using pre-defined templates.</p><p>If you just need to bang out a quick website with a small budget, Craft probably isn’t a good fit. There is no concept of themes or templates, which means everything must be designed from scratch.</p>', 'https://www.bigcommerce.com/', 'Craft'),
